export default function Database(){
    return (
        <div className='db'>
            <h1>List of Properties</h1>
            {fetch('/query').then(res=> res.json())
            .then((data)=>{
                data.map((property)=>(
                    <div className="property">
                        <h1>{property.price}</h1>
                        <h1>{property.beds}</h1>
                        <h1>{property.baths}</h1>
                        <h1>{property.status}</h1>
                    </div>
                ))
            })}
        </div>
    )
}
